import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';
import * as actions from './redux/actions';
import { Line } from '@ant-design/charts';


const data = [
    { template: '1991', value: 3 },
    { template: '1992', value: 4 },
    { template: '1993', value: 3.5 },
    { template: '1994', value: 5 },
    { template: '1995', value: 4.9 },
    { template: '1996', value: 6 },
    { template: '1997', value: 7 },
    { template: '1998', value: 9 },
    { template: '1999', value: 13 },
  ];

 const config = {
    data,
    height: 400,
    xField: 'template',
    yField: 'value',
    point: {
      size: 5,
      shape: 'diamond',
    },
  };

export class TemplateChart extends Component {
  render() {
    return (
     <Line {...config} />
    );
  }
}

/* istanbul ignore next */
function mapStateToProps(state) {
  return {
    home: state.home,
  };
}

/* istanbul ignore next */
function mapDispatchToProps(dispatch) {
  return {
    actions: bindActionCreators({ ...actions }, dispatch)
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(TemplateChart);
